import styled from "@emotion/styled";

export const FriendListWrapper = styled.div`
    width: 100%;
    margin: .5em 0 0 0;
    height: 9em;
    box-shadow: 0 0 10px #181818;
    padding: .5em;
    display: flex;
    img {
        width: 6em;
        border-radius: .5em;
        object-fit: cover;
    }
    h1 {
        margin-left: .5em;
    }
`
